          <div class="placeholder-port "></div>
          <div class="placeholder-port "></div>
          <div class="placeholder-port "></div>
          <div class="placeholder-port "></div>
          <div class="placeholder-port"></div>
          <div class="placeholder-port"></div>    
        </div>
        <div class="switchInfo">
          <header>
            <h2>Current Switch: {selectedswitch.portid}</h2>
          </header>
          <div class="infoContainer">
          <ReactTabulator
              selectable={1}
              data={switchData}
              columns={switchColumns}
              layout={"fitColumns"}
            />
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
